import React from "react";

const Sidebar = () => {
  return (
    <aside className="w-64 bg-gray-800 text-white p-4">
      <ul>
        <li>Dashboard</li>
        <li>Leads</li>
        <li>Analytics</li>
      </ul>
    </aside>
  );
};

export default Sidebar;
